&lt;h2&gt;Bộ đ&amp;ocirc;i iPhone 7 v&amp;agrave; iPhone 7 Plus đ&amp;atilde; ch&amp;iacute;nh thức được Apple giới thiệu với nhiều n&amp;acirc;ng cấp về mặt cấu h&amp;igrave;nh cũng như t&amp;iacute;nh năng.&lt;/h2&gt;

&lt;h3&gt;&lt;strong&gt;Thiết kế quen thuộc&lt;/strong&gt;&lt;/h3&gt;

&lt;p&gt;Tương tự như bộ đ&amp;ocirc;i&amp;nbsp;&lt;a href="https://www.thegioididong.com/dtdd/iphone-6s" target="_blank" title="Điện thoại iPhone 6s"&gt;iPhone 6s&lt;/a&gt;&amp;nbsp;v&amp;agrave; 6s Plus ra mắt năm ngo&amp;aacute;i th&amp;igrave; thiết kế của&amp;nbsp;&lt;strong&gt;iPhone 7&lt;/strong&gt;&amp;nbsp;năm nay cũng kh&amp;ocirc;ng c&amp;oacute; nhiều sự thay đổi. Điểm dễ d&amp;agrave;ng nhận thấy sự kh&amp;aacute;c biệt nhất giữa iPhone 6s v&amp;agrave; iPhone 7 ch&amp;iacute;nh l&amp;agrave; phần dải nhựa bắt s&amp;oacute;ng đ&amp;atilde; được đưa l&amp;ecirc;n phần cạnh tr&amp;ecirc;n thay v&amp;igrave; cắt ngang mặt lưng như trước.&lt;/p&gt;

&lt;p&gt;&lt;a href="https://www.thegioididong.com/images/42/74110/iphone-711.jpg" onclick="return false;"&gt;&lt;img alt="Thiết kế khá tương đồng với iPhone 6s" src="https://cdn2.tgdd.vn/Products/Images/42/74110/iphone-711.jpg" title="Thiết kế khá tương đồng với iPhone 6s" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;em&gt;Thiết kế kh&amp;aacute; tương đồng với iPhone 6s&lt;/em&gt;&lt;/p&gt;

&lt;p&gt;Ngo&amp;agrave;i ra th&amp;igrave; phần camera tr&amp;ecirc;n iPhone 7 cũng lồi l&amp;ecirc;n kh&amp;aacute; nhiều v&amp;agrave; c&amp;oacute; k&amp;iacute;ch thước lớn hơn hẳn so với c&amp;aacute;c thế hệ iPhone trước. iPhone 7 cũng được bổ sung th&amp;ecirc;m m&amp;agrave;u mới l&amp;agrave; m&amp;agrave;u đen b&amp;oacute;ng m&amp;agrave; Apple gọi l&amp;agrave;&amp;nbsp;Jet Black tuy nhi&amp;ecirc;n m&amp;agrave;u mới n&amp;agrave;y kh&amp;aacute; bỏng bẩy v&amp;agrave; dễ bị trầy xước nếu bạn kh&amp;ocirc;ng sắm cho m&amp;igrave;nh một chiếc ốp lưng trong qu&amp;aacute; tr&amp;igrave;nh sử dụng.&lt;/p&gt;

&lt;p&gt;&lt;a href="https://www.thegioididong.com/images/42/74110/iphone-710.jpg" onclick="return false;"&gt;&lt;img alt="Màu Jet Black mới" src="https://cdn4.tgdd.vn/Products/Images/42/74110/iphone-710.jpg" title="Màu Jet Black mới" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;em&gt;M&amp;agrave;u Jet Black mới&lt;/em&gt;&lt;/p&gt;

&lt;p&gt;&lt;a href="https://www.thegioididong.com/images/42/74110/iphone-75.jpg" onclick="return false;"&gt;&lt;img alt="Tất cả các màu sắc của iPhone 7" src="https://cdn1.tgdd.vn/Products/Images/42/74110/iphone-75.jpg" title="Tất cả các màu sắc của iPhone 7" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;em&gt;Tất cả c&amp;aacute;c m&amp;agrave;u sắc của iPhone 7&lt;/em&gt;&lt;/p&gt;

&lt;p&gt;Ph&amp;iacute;m Home vật l&amp;yacute; tr&amp;ecirc;n iPhone cũng đ&amp;atilde; biến mất v&amp;agrave; thay v&amp;agrave;o đ&amp;oacute; l&amp;agrave; sự kết hợp với&amp;nbsp;Taptic Engine mới, li&amp;ecirc;n kết với 3D Touch để biến th&amp;agrave;nh một n&amp;uacute;t&amp;nbsp;Home&amp;nbsp;cảm ứng.&lt;/p&gt;

&lt;p&gt;&lt;a href="https://www.thegioididong.com/images/42/74110/iphone-76.jpg" onclick="return false;"&gt;&lt;img alt="Phím Home cảm ứng lực" src="https://cdn3.tgdd.vn/Products/Images/42/74110/iphone-76.jpg" title="Phím Home cảm ứng lực" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;em&gt;Ph&amp;iacute;m Home cảm ứng lực&lt;/em&gt;&lt;/p&gt;

